<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <title>Title</title>
</head>
<body>
<script>
    let A = [7, 2, 5, 3, 5, 3];
    let B = [7, 2, 5, 4, 6, 3, 5, 3];
    let setA = new Set(A);
    let setB = new Set(B);
    let missingSet = new Set();

    for (let num of setB) {
        if (!setA.has(num)) {
            missingSet.add(num);
        }
    }

    let result = Array.from(missingSet);
    console.log(result)
</script>
</body>
</html>
